import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <ul>
      <li><Link to="/store">Store</Link></li>
      <li><Link to="/cart">Cart</Link></li>
    </ul>
  )
}

export default Navbar;
